  false,\n\t\"url\": null,\n\t\"notes\": \"NatureServe and Heritage Program collaborators
  have developed a Climate Change Vulnerability Index (CCVI) to provide a rapid, scientifically
  defensible assessment of species' vulnerability to climate change. The CCVI integrates
  information about exposure to altered climates and species-specific sensitivity
  factors known to be associated with vulnerability to climate change. This project
  is applying the CCVI to 64 species selected in collaboration with state wildlife
  staff and other experts.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
